var Box = React.createClass({displayName: "Box",
  render: function() {
    var windowHeight  = $(window).outerHeight();
    var windowWidth   = $(window).outerWidth();
    var styles = {backgroundColor: "red",
                  width: "300px",
                  height: "200px"};
    return React.createElement("div", {style: styles}, 
              "This was generated by React.", 
              React.createElement("p", null, "Window Height: ", windowHeight), 
              React.createElement("p", null, "Window Width: ", windowWidth)
           );
  }
});
